module.exports = function (fileName, sheetsName = null) {
    return new Promise((resolve, reject) => {
        if (sheetsName === null) {
            readXlsxFile(fileName).then((rows) => {
                resolve(rows);
            }).catch((err) => {
                reject(err);
            });
        } else if (typeof sheetsName === "string" || typeof sheetsName === "number") {
            readXlsxFile(fileName, { sheet: sheetsName }).then((rows) => {
                resolve(rows);
            }).catch((err) => {
                reject(err);
            });
        } else {
            readXlsxFile(fileName).then((rows) => {
                resolve(rows);
            }).catch((err) => {
                reject(err);
            });
        }
    })
};